import React from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Button,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  SelectChangeEvent,
} from '@mui/material';
import { Employee, Department, Account } from '../services/storageService';

interface EmployeeDialogProps {
  open: boolean;
  onClose: () => void;
  onSave: (employee: Employee) => void;
  employee?: Employee;
  mode: 'add' | 'edit';
  departments: Department[];
  accounts: Account[];
  nextEmployeeId: string;
}

const EmployeeDialog: React.FC<EmployeeDialogProps> = ({
  open,
  onClose,
  onSave,
  employee,
  mode,
  departments,
  accounts,
  nextEmployeeId,
}) => {
  const [formData, setFormData] = React.useState<Employee>({
    id: employee?.id || nextEmployeeId,
    account: employee?.account || '',
    position: employee?.position || '',
    department: employee?.department || '',
    hireDate: employee?.hireDate || new Date().toISOString().split('T')[0],
    status: employee?.status || 'Active',
  });

  React.useEffect(() => {
    if (employee) {
      setFormData(employee);
    } else {
      setFormData(prev => ({
        ...prev,
        id: nextEmployeeId,
      }));
    }
  }, [employee, nextEmployeeId]);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSelectChange = (e: SelectChangeEvent) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = () => {
    onSave(formData);
    onClose();
  };

  return (
    <Dialog open={open} onClose={onClose} maxWidth="sm" fullWidth>
      <DialogTitle>{mode === 'add' ? 'Add Employee' : 'Edit Employee'}</DialogTitle>
      <DialogContent>
        <TextField
          fullWidth
          margin="normal"
          label="Employee ID"
          name="id"
          value={formData.id}
          disabled
        />
        <FormControl fullWidth margin="normal">
          <InputLabel>Account</InputLabel>
          <Select
            name="account"
            value={formData.account}
            label="Account"
            onChange={handleSelectChange}
          >
            <MenuItem value="Employee@UCmain.com">Employee Account</MenuItem>
            <MenuItem value="Admin@UCmain.com">Admin Account</MenuItem>
          </Select>
        </FormControl>
        <TextField
          fullWidth
          margin="normal"
          label="Position"
          name="position"
          value={formData.position}
          onChange={handleInputChange}
        />
        <FormControl fullWidth margin="normal">
          <InputLabel>Department</InputLabel>
          <Select
            name="department"
            value={formData.department}
            label="Department"
            onChange={handleSelectChange}
          >
            {departments.map((dept) => (
              <MenuItem key={dept.name} value={dept.name}>
                {dept.name}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <TextField
          fullWidth
          margin="normal"
          label="Hire Date"
          name="hireDate"
          type="date"
          value={formData.hireDate}
          onChange={handleInputChange}
          InputLabelProps={{
            shrink: true,
          }}
        />
        <FormControl fullWidth margin="normal">
          <InputLabel>Status</InputLabel>
          <Select
            name="status"
            value={formData.status}
            label="Status"
            onChange={handleSelectChange}
          >
            <MenuItem value="Active">Active</MenuItem>
            <MenuItem value="Inactive">Inactive</MenuItem>
          </Select>
        </FormControl>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Cancel</Button>
        <Button onClick={handleSubmit} variant="contained" color="primary">
          {mode === 'add' ? 'Add' : 'Save'}
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default EmployeeDialog;
